var cuisines = Object.keys(foodDatabase);

export default function App() {
  const [cuisine, setCuisine] = useState("Italian");

  function cuisineClickHandler(item) {
    //console.log(item);
    setCuisine(item);
  }

  return (
    <div className="App">
      <h1> Food Cuisine </h1>
      <h2>Good food for Good Moments !</h2>
      <div>
        {cuisines.map((item) => {
          return (
            <button
              className="genre"
              key={item}
              onClick={() => cuisineClickHandler(item)}
            >
              {item}
            </button>
          );
        })}
      </div>
      <div className="cuisines">
        <ul className="lists">
          {foodDatabase[cuisine].map((currentCuisine, index) => {
            return (
              <li key={index} className="list-item">
                <img
                  src={currentCuisine.image}
                  alt={currentCuisine.name}
                  width="150"
                  height="120"
                />
                <div className="ingredients">
                  <h2>{currentCuisine.name}</h2>
                  <p>Ingredients : {currentCuisine.ingredients}</p>
                  <p>Rating: {currentCuisine.rating}/ 5</p>
                </div>
              </li>
            );
          })}
        </ul>
      </div>
    </div>
  );
}
